CREATE TABLE airports (
   airport_city_code TEXT,
   airport_country_code TEXT,
   airport_name_translations_en TEXT,
   airport_time_zone TEXT,
   airport_flightable INTEGER,
   airport_coordinates_lat FLOAT,
   airport_coordinates_lon FLOAT,
   airport_name TEXT,
   airport_code VARCHAR(5),
   airport_iata_type TEXT,
   PRIMARY KEY (airport_code)
);

